Focus.Views.QuizScoreView = Backbone.View.extend({
    el: $('#score-view'),
    initialize: function (options) {
        options = options || {};
        var count = options.count || 10;
        var items = [];

        for (var i = 1; i <= count; ++i) {
            items.push({
                index: i,
                complete: false,
                correct: false,
                value: 1
            });
        }

        this.collection = new Focus.Collections.ScoreItemCollection(items);

        this._setupChart();

        this.listenTo(this.collection, 'change', this.render);

        this._score = 0;

    },
    incrementScore: function (model) {
        var found = this.collection.findWhere({
            index: model.index
        });

        if (model.correct) {
            this._score++;
        }

        found.set(model);
        found.set('complete', true);
    },
    _setupChart: function () {
        var width = this.$el.width();
        var height = this.$el.height();
        var radius = Math.min(width, height) / 2;
        this._svg = d3.select(this.$el[0])
            .append("svg")
            .append("g")

        this._svg.append("g")
            .attr("class", "slices");
        this._svg.append("g")
            .attr("class", "labels");
        this._svg.append("g")
            .attr("class", "lines");

        this._svg.attr("transform", "translate(" + radius + "," + radius + ")");
    },
    _buildPie: function () {
        var me = this;
        var width = this.$el.width();
        var height = this.$el.height();

        this.$el.find('h3').html(this._score);

        var radius = Math.min(width, height) / 2;

        var pie = d3.layout.pie()
            .sort(null)
            .value(function (d) {
                return d.value;
            });

        var arc = d3.svg.arc()
            .innerRadius(radius * 0.3)
            .outerRadius(radius * 0.4);

        var midArc = d3.svg.arc()
            .innerRadius(radius * 0.4)
            .outerRadius(radius * 0.6);

        var outerArc = d3.svg.arc()
            .innerRadius(radius * 0.8)
            .outerRadius(radius * 0.9);

        var key = function (d) {
            return d.data.index;
        };

        var change = function (data) {
            /* ------- PIE SLICES -------*/
            var slice = me._svg.select(".slices").selectAll("path.slice")
                .data(pie(data), key);

            slice.enter()
                .insert("path")
                .style("fill", function (d) {
                    if (d.data.complete) {
                        if (d.data.correct) {
                            return 'green';
                        }
                        else {
                            return 'red';
                        }
                    }
                    else {
                        return 'gray';
                    }
                })
                .style("stroke", '#333') //"rgba(0,0,0,0.25)")
                //.style("opacity", 0.5)
                .attr("class", "slice")
                .on('mouseover', function (e) {
                    //d3.select(this).style('fill', 'rgba(255,165,0,0.0)');
                })
                .on('mouseout', function (d, i) {
                    //if (!d.data.selected) {
                    //    d3.select(this).style('fill', 'rgba(255,165,0,0.5)');
                    //}
                })
                .on('click', function (d, i) {
                    //change(next(d));
                });

            slice
                .transition().duration(1000)
                .style("fill", function (d) {
                    if (d.data.complete) {
                        if (d.data.correct) {
                            return 'green';
                        }
                        else {
                            return 'red';
                        }
                    }
                    else {
                        return 'gray';
                    }
                })
                .attrTween("d", function (d) {
                    this._current = this._current || d;
                    var interpolate = d3.interpolate(this._current, d);
                    this._current = interpolate(0);
                    return function (t) {
                        return outerArc(interpolate(t));
                    };
                });

            slice.exit()
                .remove();

        };

        change(this.collection.toJSON());


    },
    render: function () {
        this._buildPie();
        return this;
    }
});

